import React, {useEffect,useState} from "react";
import { useHistory } from "react-router-dom";
import Header from "./Header";
import jwt from 'jsonwebtoken'

const MenuDisplay=()=>{
    const history=useHistory()

    const goback=()=>{
        window.location.href='/studentdashboard'
    }

    const [vegfood,setVegfood]=useState([]);
    const [nonvegfood,setNonvegfood]=useState([]);

    useEffect(()=>{
        const getData = async()=>{
            const url = "http://localhost:1337/api/foodtoday";
            const response = await fetch(url);
            const data = await response.json();
            for(let i=data.user.length-1;i>=-1;i--){
                setVegfood(json.user[i].vegfood);
                setNonvegfood(json.user[i].nonvegfood);
            }
        };
        getData();

    })
}

export default MenuDisplay
